import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import { Navbar } from "./Navbar";

function HomePage(): JSX.Element {
  return (
    <div className="container">
      <div className="row">
        <Navbar/>
      </div>
      Welcome to my home page!
    </div>
  );
}

export default HomePage;
